import { Component, ElementRef, OnInit, ViewChild } from '@angular/core';
import { FormBuilder, FormGroup } from '@angular/forms';
import { Observable } from 'rxjs';
import { DocenteCancelacion, EstudiantesCancelacion, ReporteEncuesta } from 'src/app/core/model/reportes';
import { AuthService } from 'src/app/core/services/auth.service';
import { DocenteService } from 'src/app/services/docentes.service';


//para pdf
import htmlToPdfmake from 'html-to-pdfmake';
import pdfMake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';
pdfMake.vfs = pdfFonts.pdfMake.vfs;

@Component({
  selector: 'app-reportes',
  templateUrl: './reportes.component.html',
  styleUrls: ['./reportes.component.scss']
})
export class ReportesComponent implements OnInit {

  @ViewChild('pdfTable') pdfTable: ElementRef;

  imagenLogo = "";
  texto = "";
  nombrePEriodo = "";
  formatoHoja ="";
  nombreDocente ="";
  asignatura = "";
  ciclo ="";
  columna =[];
  aspirante =""; //nombre del estudiante para trabajo de titulacion
  temaTrabajo =""; //tema de titulacion
  tablaDatos = [];
  listaPeriodos: {}[];
  listaMaterias: {}[];
  listaEstudianteTitulacion: {}[];
  listaDatos: EstudiantesCancelacion[];
  listaDatosD: DocenteCancelacion[];
  listaDatosEncuesta: ReporteEncuesta[];

  tiposReportes = [
    { code: 0, name: 'Tutorías Canceladas por Docente' },
    { code: 1, name: 'Tutorías Canceladas por Estudiantes' },
    { code: 2, name: 'Encuestas a Tutorías' },
    { code: 3, name: 'Tutorías Académicas' },
    { code: 4, name: 'Tutorías Titulación' },
  ]

  paraleloEstudiante = [
    {name: 'A', code: "A"},
    {name: 'B', code: "B"}
  ]

  formFiltros: FormGroup;

  escuchador: Observable<any>;

  constructor(
    private docenteService: DocenteService,
    private authService: AuthService,
    private fb: FormBuilder

  ) {
    this.formFiltros = this.fb.group({
      tiposReportes: [{ value: null, disabled: true }],
      periodoAcademico: [],
      materiaReporte: [{ value: null, disabled: true }],
      paraleloEstudiante: [{ value: null, disabled: true }],
      estudianteReporte: []

    });
    this.formFiltros.get('tiposReportes').valueChanges.subscribe(_ => {
      if (_) {
        const { code } = _;
        switch (code) {
          case 0:
            this.escuchador = this.docenteService.postCanceladaPorDocente(this.authService.externalUsuario, this.formFiltros.get('periodoAcademico').value?.code);
            this.formFiltros.get('materiaReporte').disable();
            this.formFiltros.get('paraleloEstudiante').disable();

            this.nombrePEriodo = this.formFiltros.get('periodoAcademico').value?.name;
            this.texto = 'REPORTES DE TUTORÍAS CANCELADAS POR DOCENTES\n\n\n';
            this.nombreDocente = `Nombre docente: ${this.authService.nombreUsuario}`  + '\n\n';
            this.formatoHoja = 'portrait';
            this.columna = [11, 50, '*', '*', '*', '*'];
            this.asignatura = '';
            this.ciclo = '' ;
            this.tablaDatos = [['#','Tema Tutoría', 'Modalidad', 'Fecha', 'Hora Inicio', 'Tipo Tutoría']];
            break;
          case 1:
            this.escuchador = this.docenteService.postCanceladaPorEstudiantes(this.authService.externalUsuario, this.formFiltros.get('periodoAcademico').value?.code);
            this.formFiltros.get('materiaReporte').disable();
            this.formFiltros.get('paraleloEstudiante').disable();

            this.nombrePEriodo = this.formFiltros.get('periodoAcademico').value?.name;
            this.texto = 'REPORTES DE TUTORÍAS CANCELADAS POR ESTUDIANTES\n\n\n';
            this.nombreDocente = `Nombre docente: ${this.authService.nombreUsuario}`  + '\n\n';

            this.formatoHoja = 'portrait';
            this.columna = [11, 50, '*', '*', '*', '*'];
            this.asignatura = '';
            this.ciclo = '' ;
            this.tablaDatos = [['#','Tema Tutoría', 'Modalidad', 'Fecha', 'Hora Inicio', 'Tipo Tutoría']];

            break;
          case 2:
            this.escuchador = this.docenteService.postReporteEncuesta(this.authService.externalUsuario, this.formFiltros.get('periodoAcademico').value?.code);
            this.formFiltros.get('materiaReporte').disable();
            this.formFiltros.get('paraleloEstudiante').disable();


            this.nombrePEriodo = this.formFiltros.get('periodoAcademico').value?.name;
            this.texto = 'REPORTES DE ENCUESTAS DE TUTORÍAS \n\n\n';
            this.nombreDocente = `Nombre docente: ${this.authService.nombreUsuario}`  + '\n\n';

            this.formatoHoja = 'portrait';
            this.columna = [12, '*', '*', '*', '*', '*'];

            this.tablaDatos = [['#','Satisfacción', 'Dudas Aclaradas', 'Tiempo Necesario', 'Observación']];
            break;
          case 3:
            this.formFiltros.get('materiaReporte').enable();
            this.formFiltros.get('paraleloEstudiante').enable();
            break;
          case 4:
            this.formFiltros.get('estudianteReporte').enable();
            break;

        }
      }
    })

    this.formFiltros.get('paraleloEstudiante').valueChanges.subscribe(paralelo => {
      if (paralelo) {
        debugger
        this.escuchador = this.docenteService.postDocenteTutoriasDadas(
          this.authService.externalUsuario,
          this.formFiltros.get('periodoAcademico').value?.code,
          this.formFiltros.get('materiaReporte').value?.code,
          paralelo.code

          );

          this.nombrePEriodo = this.formFiltros.get('periodoAcademico').value?.name;
          this.texto = 'REGISTRO PARA EL CONTROL DE TUTORÍAS ACADÉMICAS \n\n\n';
          this.formatoHoja = 'landscape';
          this.nombreDocente = `Nombre docente: ${this.authService.nombreUsuario}`  + '\n\n';
          this.asignatura = 'Asignatura: ' + this.formFiltros.get('materiaReporte').value?.name + '\n\n';
          this.ciclo = 'Ciclo/Paralelo: ' ;

          this.temaTrabajo= '';
          this.aspirante = '';

          this.columna = [11,'*', '*', '*', '*', '*', 50, '*'];

          this.tablaDatos = [['#','Fecha', 'hora','Estudiante','Tema Tratado', 'Modalidad','Actividad', 'Firma Estudiante' ]];
      }
    })

    this.formFiltros.get('estudianteReporte').valueChanges.subscribe(estudiante =>{
        if (estudiante) {
          this.escuchador = this.docenteService.posttutorirasTitulacionDadas(
            this.authService.externalUsuario,
            this.formFiltros.get('periodoAcademico').value?.code,
            estudiante.code);

            this.nombrePEriodo = this.formFiltros.get('periodoAcademico').value?.name;
            this.texto = 'REGISTRO PARA EL CONTROL DE DIRECCIÓN Y ASESORORÍA DEL TRABAJO DE TITULACIÓN \n\n\n';
            this.formatoHoja = 'portrait';
            this.temaTrabajo= 'TEMA DEL TRABAJO DE TITULACIÓN: ';
            this.aspirante = 'NOMBRE DEL ASPIRANTE: ';
            this.nombreDocente = `NOMBRE DEL DIRECTOR/ASESOR: ${this.authService.nombreUsuario}`  + '\n\n';
            this.asignatura = '';
            this.ciclo = '' ;
          this.columna = [11,'*', '*', 50, 50, '*', '*'];

            this.tablaDatos = [['#','Fecha', 'hora','Información presentada','Comentarios u observaciones','Firma Aspirante', 'Próxima Asesoría' ]];
        }

    })

    this.formFiltros.get('periodoAcademico').valueChanges.subscribe(_ => {
      if (_) {
        this.listaMaterias = [];
        this.formFiltros.get('tiposReportes').enable();
        this.formFiltros.get('materiaReporte').enable();
        this.formFiltros.get('paraleloEstudiante').enable();
        this.docenteService.postMateriasPorPeriodo(this.authService.externalUsuario, _.code).subscribe(_ => this.listaMaterias = _);
        this.docenteService.getListaEstudianteTitulacion(this.authService.externalUsuario, _.code).subscribe (_ => {
          this.listaEstudianteTitulacion = [];
          _.forEach(element => {
            if (!this.listaEstudianteTitulacion.some((e:any) => e.code  == element.code )) {
              this.listaEstudianteTitulacion.push(element);
            }
          });


        });

      }
    })
  }

  ngOnInit(): void {
    this.docenteService.getListaPeriodos().subscribe(_ => this.listaPeriodos = _);
  }


  generarReporte() {
    this.escuchador.subscribe(_ => {
      this.crearPDF(_);
    });
    this.formFiltros.reset();

  }



  // const tabla = (this.pdfTable as any).el.nativeElement;
  // let html = htmlToPdfmake((tabla as Element).innerHTML);

  //pdfMake.createPdf({content:html}).open();// abrir en el navegador
  //pdfMake.createPdf({content:html}).print();


  crearPDF(data) {
    const datosTabla = this.tablaDatos;
    if(data  && data[0]['ciclo']){
      this.ciclo += data[0]['ciclo'] + '\n\n';
    }

    if(data  && data[0]['temaTrabajo']){
      this.temaTrabajo += data[0]['temaTrabajo'] + '\n\n';
    }

    if(data  && data[0]['aspirante']){
      this.aspirante += data[0]['aspirante']  + '\n\n';
    }

    data?.forEach(element => {
      const arr = [];
      Object.keys(element).forEach(_ => {

        switch (_) {
          case 'cont':
            arr.push(element[_]);
            break;
          case 'modalidad':
            arr.push((element[_] == 1 ? 'Individual' : 'Grupal'));
            break;
          case 'horaInicio':
            const horaI = element[_].split(':');
            arr.push(`${horaI[0]}:${horaI[1]}`);
            break;
          case 'horaFin':
            // const horaF = element[_].split(':');
            // arr.push(`${horaF[0]}:${horaF[1]}`);
            break;
          case 'tipoTutoria':
            arr.push(element[_] == 0 ? 'Académica' : 'Titulación');
            break;

          //ENCUESTA
          case 'satisfaccion':
            arr.push(element[_]);
            break;
          case 'dudasAclaradas':
              arr.push((element[_] == 1 ? 'Si' : 'No'));
            break;
          case 'tiempoNecesario':
            arr.push((element[_] == 1 ? 'Si' : 'No'));
            break;
          case 'observacion':
            arr.push(element[_]);
            break;

            //ACADEMICA
            case'fecha':
            arr.push(element[_]);
              break;
            case'hora':
              arr.push(element[_]);
              break;
            case 'estudiante':
                arr.push(element[_]);
            break;
            case 'temaTutoria':
              arr.push(element[_]);
            break;
            case 'modalidadVP':
              arr.push((element[_] == 1 ? 'Virtual' : 'Académica'));
            break;
            case 'actividad':
              arr.push(element[_]);
            break;
            case 'firma':
              arr.push(element[_]);
            break;

            case 'proxima':
              arr.push(element[_]);
            break;

            //titulacion

            case 'informacionPresentada':
              arr.push(element[_]);
            break;
            case 'actividad':
              arr.push(element[_]);
            break;
          default:
            //arr.push(element[_]);
            break;
        }
      })
      datosTabla.push(arr);
    });

    pdfMake.createPdf({


      pageMargins: [ 40, 60, 40, 60 ],
      //pageMargins: [15, 15, 15, 15 ],
      pageOrientation: this.formatoHoja,
      content: [
        {
          columns:[
            {
              image: this.imganeSVG,
              width: 200,
              alignment: 'left',
            },
            {
              image:this.imagesCisSvg ,
              width: 200,
              alignment: 'right',
            },

          ],
          columnGap: 20
        },

        {
          text: 'FACULTAD DE LA ENERGÍA, LAS INDUSTRIAS Y LOS RECURSOS NATURALES NO RENOVABLES\n\n',
          fontSize: 14,
          alignment: 'center',
        },
        {
          text: this.texto,   //tipo informe o reporte
          fontSize: 14,
          alignment: 'center',
        },
        {
          text: 'CARRERA:   INGENIERÍA EN SISTEMAS/COMPUTACIÓN\n\n',
          fontSize: 11,
          alignment: 'left',
        },
        {
            //asignatura
            text: this.asignatura  ,
            fontSize: 11,
            alignment: 'left',
        },
        {
          //TEMA
          text: this.temaTrabajo,
          fontSize: 11,
          alignment: 'left',
        },
        {
          //ASPIRANTE
          text: this.aspirante ,
          fontSize: 11,
          alignment: 'left',
        },
        {
          //nombre docente
          text: this.nombreDocente ,
            fontSize: 11,
            alignment: 'left',
        },
        {
            //ciclo
            text: this.ciclo   ,
            fontSize: 11,
            alignment: 'left',
        },
        {
          text: 'Periodo académico ordinario: ' + this.nombrePEriodo + '  \n\n',
          fontSize: 11,
          alignment: 'left',
        },
        {
          //layout: 'lightHorizontalLines', // optional
          layout: 'lineHeight', // optional

          table: {
            headerRows: 1,
            //widths: ['*', '*', '*', '*', '*','*','*'],

            widths: this.columna,
            body: datosTabla
          },


        },
        {
          text: '\n\n Firmas:',
          fontSize: 11,
          alignment: 'left',
        },
        {

          //layout: 'lineHeight',
          //headerRows: 1,

          // table: {

          //   headerRows: 1,
          //   widths: [101, 100,'*'],

          //   body: [
          //     ['.                                                                                                                                   .',
          //     '.                                                                                                                                   .'],

          //     [ '.                                                                                                                                   .',
          //      '.                                                                                                                                   .'],

          //   ]
          // },
        },

      ],
      footer: {
        columns: [
          'Módulo de tutorías',
          { text: 'Carrera de Ingeniería en Sistemas/Computación', alignment: 'right' }
        ]
      },
    }).download();
  }

  imagesCisSvg ="data:image/png;base64,";

imagesCisSvgOther ="data:image/png;base64,";


  imganeSVG = "data:image/png;base64,";

}

